import { makeStyles , alpha} from '@material-ui/core/styles';

//()=>({}) : in ({}) yani return kon {} ro . dige return nminevisim  
const useStyle = makeStyles((theme)=>({
    root:{
        marginTop:'5rem',
        width:'80%',
        marginRight:'10%',
        marginLeft:'10%',
        backgroundColor:theme.palette.secondary.main,
        borderRadius:'0.2rem',
        padding:'2rem'
    }

}));

export default useStyle;
